import axios from "axios"
import {config} from "../config"

export const getFishesCount = () => {
    return axios.get(config.api_url+"/product/getallfishes/count")
    .then(response => {
        return response.data
    })
    .catch(err => {
        return err
    })
}

export const getCrustaceansCount = () => {
    return axios.get(config.api_url+"/product/getallcrustaceans/count")
    .then(response => {
        return response.data
    })
    .catch(err => {
        return err
    })
}
